  return (
    <div className="welcomeScreen">
      <div>
        <input type="text" placeholder="Number of words" max={wordsArr.length} />
        <input type="text" placeholder="Time for one word" />
        <button></button>
      </div>
      <span>
        Start
      </span>
    </div>
  );
}

export default WelcomeScreen;
